import React from 'react';
import {Link} from "react-router-dom";
const MangaItem = ({meta, srcImg, price}) => {
  return (
    <div
      className="card h-100 d-flex flex-column"
    >
      <div className="img-manga h-100">
        <img className="card-img-top" src={srcImg} alt=""/>
      </div>
      <div className="card-body item-content">
        <Link to={meta} className="title-manga">
          <p className="card-text">Boku Girl Boku Girl</p>
        </Link>
        <p className="price">{price}</p>
      </div>
    </div>
  );
};

export default MangaItem;
